import React from 'react';
import {
    Collapse,
    Navbar,
    NavbarToggler,
    NavbarBrand,
    Nav,
    NavItem,
    NavLink,
    UncontrolledDropdown,
    DropdownToggle,
    DropdownMenu,
    DropdownItem,
    Container
} from 'reactstrap';

export default class AppHeader extends React.Component {
    constructor(props) {
        super(props);

        this.toggle = this.toggle.bind(this);
        this.state = {
            isOpen: false
        };
    }
    toggle() {
        this.setState({
            isOpen: !this.state.isOpen
        });
    }
    render() {
        return (
            <div>
                <Navbar color="dark" light expand="md">
                    <Container>
                        <NavbarBrand className='text-white' href="/">reactstrap</NavbarBrand>
                        <NavbarToggler onClick={this.toggle} />
                        <Collapse isOpen={this.state.isOpen} navbar>
                            <Nav className="ml-auto" navbar>
                                <NavItem>
                                    <NavLink className='text-white' href="/components/">Components</NavLink>
                                </NavItem>
                                <NavItem>
                                    <NavLink className='text-white' href="https://github.com/reactstrap/reactstrap">GitHub</NavLink>
                                </NavItem>
                                <UncontrolledDropdown nav inNavbar>
                                    <DropdownToggle className='text-white' nav caret>
                                        Options
                </DropdownToggle>
                                    <DropdownMenu right>
                                        <DropdownItem className='text-primary'>
                                            Option 1
                  </DropdownItem>
                                        <DropdownItem className='text-primary'>
                                            Option 2
                  </DropdownItem>
                                        <DropdownItem divider />
                                        <DropdownItem className='text-primary'>
                                            Reset
                  </DropdownItem>
                                    </DropdownMenu>
                                </UncontrolledDropdown>
                            </Nav>
                        </Collapse>
                    </Container>
                </Navbar>

            </div>
        );
    }
}
